// About.js

import React from 'react';

const About = () => {
  return (
    <div className="container mx-auto my-8 p-8 bg-white shadow-md rounded-md">
      <h1 className="text-3xl font-bold mb-4">About Us</h1>
      <p className="text-gray-700 mb-4">
        Welcome to our website! Lorem ipsum dolor sit amet, consectetur adipiscing elit.
        Sed do eiusmod tempor incididunt ut labore et dolore magna aliqua. Ut enim ad minim veniam,
        quis nostrud exercitation ullamco laboris nisi ut aliquip ex ea commodo consequat.
      </p>
      <p className="text-gray-700">
        Our mission is to provide the best user experience and deliver high-quality content to our users.
        We are passionate about what we do and are dedicated to making your experience on our site enjoyable.
      </p>
    </div>
  );
};

export default About;
